from bb_wrapper.services import BarcodeService
from bb_wrapper.services.barcode_cobranca import BarcodeCobrancaService
from bb_wrapper.models.barcode import BarcodeCobranca, BarcodeTributo
from ..utils import BarcodeAndCodeLineTestCase


class BarcodeTestCase(BarcodeAndCodeLineTestCase):
    def test_generate_barcode_b64image_1(self):
        """
        Dado:
            - um número de código de barras
        Quando:
            - for chamado BarCodeService().generate_barcode_b64image(barcode_number)
        Então:
            - o resultado deve ser ¯\_(ツ)_/¯  # noqa
        """
        barcode_number = "00193846200000100000000003128557123123001317"

        result = BarcodeService().generate_barcode_b64image(barcode_number)

        expected = "data:image/svg+xml;base64,"  # noqa

        self.assertEqual(result, expected)

    def test_generate_barcode_b64image_2(self):
        """
        Dado:
            - um número de código de barras
        Quando:
            - for chamado BarCodeService().generate_barcode_b64image(barcode_number)
        Então:
            - o resultado deve ser ¯\_(ツ)_/¯  # noqa
        """
        barcode_number = "00193846200000100000000003128557123123001317"

        result = BarcodeService().generate_barcode_b64image(barcode_number, False)

        expected = "data:image/svg+xml;base64,"  # noqa: E501

        self.assertEqual(result, expected)

    def test_identify_cobrancas_barcode(self):
        for barcode, code_line in self.cobrancas_barcodes_to_code_lines.items():
            with self.subTest(barcode):
                instance = BarcodeService().identify(barcode)
                self.assertIsInstance(instance, BarcodeCobranca)
                self.assertEqual(instance.code_line, code_line)
                self.assertEqual(
                    instance.barcode_image,
                    BarcodeService().generate_barcode_b64image(barcode),
                )

